import React from "react";
import Entry from "./Entry";
import emojipedia from "../emojipedia";

function createEntry(pedia){
  return(
    <Entry 
      key={pedia.id}
      emoji={pedia.emoji}
      name={pedia.name}
      meaning={pedia.meaning}
    />
  );
}

function App() {
  return (
    <div>
      <h1>
        <span>emojipedia</span>
      </h1>

      <dl className="dictionary">
        {emojipedia.map(createEntry)}
      </dl>
    </div>
  );
}

export default App;
